  [],\n\t\"revision_timestamp\": \"2016-07-27T22:49:29.797934\",\n\t\"name\": \"national-bison-range-refuge-narrative-report-calendar-year-1965\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for National
  Bison Range outlines Refuge accomplishments during the 1965 calendar year. The report
  begins by summarizing the weather conditions, habitat conditions, water conditions,
  and food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  reptiles, and diseases- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and vegetation control. Resource
  management is outlined; topics include sale of surplus animals. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, hunting, violations,
  and safety. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
